class Cell {
    constructor(x, y, symbol, color) {
        this.x = x;
        this.y = y;
        this.symbol = symbol;
        this.color = color;
    }
    draw(ctx) {
        ctx.fillStyle = 'white';
        ctx.fillText(this.symbol, this.x + 0.5, this.y + 0.5);
        ctx.fillStyle = this.color;
        ctx.fillText(this.symbol, this.x, this.y);
    }
}

class AsciiEffect {
    #imageCellArray = [];
    #pixels = [];
    #ctx;
    #width;
    #height;
    constructor(ctx, width, height) {
        this.#ctx = ctx;
        this.#width = width;
        this.#height = height;
        this.#ctx.drawImage(image1, 0, 0, this.#width, this.#height);
        this.#pixels = this.#ctx.getImageData(0, 0, this.#width, this.#height);
        console.log(this.#pixels.data);
    }
    #convertToSymbol(avg_color_val) {
        if (avg_color_val > 300) return '@';
        else if (avg_color_val < 20) return 'M';
        else if (avg_color_val < 40) return 'L';
        else if (avg_color_val < 60) return 'K';
        else if (avg_color_val < 70) return 'J';
        else if (avg_color_val < 80) return 'I';
        else if (avg_color_val < 90) return '!';
        else if (avg_color_val < 100) return '*';
        else if (avg_color_val < 110) return '/';
        else if (avg_color_val < 120) return '+';
        else if (avg_color_val < 130) return '$';
        else if (avg_color_val < 140) return '#';
        else if (avg_color_val < 150) return 'F';
        else if (avg_color_val < 160) return '&';
        else if (avg_color_val < 170) return '%';
        else if (avg_color_val < 180) return 'A';
        else if (avg_color_val < 190) return '_';
        else if (avg_color_val < 200) return 'B';
        else if (avg_color_val < 210) return ':';
        else if (avg_color_val < 220) return 'C';
        else if (avg_color_val < 230) return 'G';
        else if (avg_color_val < 240) return 'D';
        else if (avg_color_val < 250) return 'H';
        else if (avg_color_val < 260) return 'E';
        else if (avg_color_val < 270) return '-';
        else if (avg_color_val < 280) return 'X';
        else if (avg_color_val < 290) return 'W';
        else return '';
    }
    #scanImage(cellSize) {
        this.#imageCellArray = [];
        for (let y = 0; y < this.#pixels.height; y += cellSize) {
            for (let x = 0; x < this.#pixels.width; x += cellSize) {
                const posX = x * 4;
                const posY = y * 4;
                const pos = (posY * this.#pixels.width) + posX; // all complete rows + current x position in current row

                // if pixel is not transparent (less than 128 opacity), then apply the const values to the pixel data
                if (this.#pixels.data[pos + 3] > 128) {
                    const red = this.#pixels.data[pos];
                    const green = this.#pixels.data[pos + 1];
                    const blue = this.#pixels.data[pos + 2];
                    const total = red + green + blue;
                    const averageColorValue = total / 3;
                    const color = "rgb(" + red + "," + green + "," + blue + ")";
                    const symbol = this.#convertToSymbol(averageColorValue)
                    if (total > 200) this.#imageCellArray.push(new Cell(x, y, symbol, color));
                }
            }
        }
        console.log(this.#imageCellArray);
    }
    #drawAscii() {
        this.#ctx.clearRect(0, 0, this.#width, this.#height);
        for (let i = 0; i < this.#imageCellArray.length; i++) {
            this.#imageCellArray[i].draw(this.#ctx);
        }
    }
    draw(cellSize) {
        this.#scanImage(cellSize);
        this.#drawAscii();
    }
}
let effect;

function handleSlider() {
    if (inputSlider.value == 1) {
        inputLabel.innerHTML = 'Original image'
        ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
    } else {
        inputLabel.innerHTML = 'Resolution ' + inputSlider.value + ' px';
        ctx.font = parseInt(inputSlider.value) * 1 + 'px Verdana';
        effect.draw(parseInt(inputSlider.value));

    }
}
image1.onload = function initialize() {
    canvas.width = image1.width;
    canvas.height = image1.height;
    // ctx.drawImage(image1, 0, 0);
    effect = new AsciiEffect(ctx, image1.width, image1.height);
    handleSlider();
    console.log(effect);
    // effect.draw(2); this controls the image pixelation for the first time when the page initially loads
}
